import './App.css';
import Card from './components/card.component'

function App() {

    const categories = [
      {
        id: 1,
        title: 'Hats',
      },
      {
        id: 2,
        title: 'Jackets',
      },
      {
        id: 3,
        title: 'Sneakers',
      },
      {
        id: 4,
        title: 'Womens',
      },
      {
        id: 5,
        title: 'Mens',
      },
    ];

    return (
      <div className="App">
div className='categories-container'>
      {categories.map((category) => (
        <Card key={category.id} category={category} />
      ))}
    </div>      
  );
}

export default App;
